import {FETCH_TREE, ADD_NODE} from '../action/constant';

export default (state = [], action) => {
    switch (action.type) {
      case FETCH_TREE:
        return [...state,action.payload];
    //   case ADD_NODE :
    //     return [...state,action.payload]
      default:
        return state;
    }
  };
